<script>
import gsap from 'gsap';

// let ytl = gsap.timeline();
// let xtl = gsap.timeline();

export default {
	data: function(){
		return {
			currentPlanet: null,
			planetPathDuration: 4,
			timelineSets: { // Timelines for planet paths
				rgptl: { // Red-Green Planet Timelines
					x: gsap.timeline(), // X Timeline
					y: gsap.timeline(), // Y Timeline
					z: gsap.timeline()  // Z Timeline
				},
				bwptl: { // Black-White Planet Timelines
					x: gsap.timeline(),
					y: gsap.timeline(),
					z: gsap.timeline()
				},
				bgptl: { // Big Green Planet Timelines
					x: gsap.timeline(),
					y: gsap.timeline(),
					z: gsap.timeline()
				}
			},
			pages: {
				bgp: '.skills-and-titles',
				rgp: '.about-me',
				bwp: '.projects-and-interests'
			},
			tlPaused: false
		}
	},
    methods: {
		ResetTimelines(){
			for(const i in this.timelineSets){
				this.timelineSets[i].x = gsap.timeline();
				this.timelineSets[i].y = gsap.timeline();
				this.timelineSets[i].z = gsap.timeline();
			}
		},

		RedGreenPlanetPath(){
			const planet = document.getElementById('red-planet-green-ring');

			const xtl = this.timelineSets.rgptl.x;
			const ytl = this.timelineSets.rgptl.y;
			const ztl = this.timelineSets.rgptl.z;

			// Set path to leftmost edge
			gsap.set(planet, {
				x: '-30vw',
				xPercent: -50,
				yPercent: -50,
				top: '50%',
				left: '50%'
			})

			// x animation
			xtl.to(planet, {
				duration: this.planetPathDuration * 2,
				x: '+=60vw',
				ease: 'power1.inOut',
				yoyo: true,
				repeat: -1
			});

			// y animation
			ytl.to(planet, {
				duration: this.planetPathDuration,
				y: '+=5vw',
				ease: 'power1.out'
			}).to(planet, {
				duration: this.planetPathDuration,
				y: '-=5vw',
				ease: 'power1.in'
			})

			// Layer behind the Sun
			.set(planet, {
				css: {
					zIndex: 4
				}
			})

			// Continue y animation
			.to(planet, {
				duration: this.planetPathDuration,
				y: '-=5vw',
				ease: 'power1.out'
			}).to(planet, {
				duration: this.planetPathDuration,
				y: '+=5vw',
				ease: 'power1.in'
			}).repeat(-1);

			// Z (width/size) animation
			ztl.to(planet, {
				duration: this.planetPathDuration,
				// width: '+=4vw',
				scale: 1.6,
				ease: 'power1.out'
			}).to(planet, {
				duration: this.planetPathDuration,
				// width: '-=4vw',
				scale: 1,
				ease: 'power1.in'
			}).to(planet, {
				duration: this.planetPathDuration,
				// width: '-=4vw',
				scale: .4,
				ease: 'power1.out'
			}).to(planet, {
				duration: this.planetPathDuration,
				// width: '+=4vw',
				scale: 1,
				ease: 'power1.in'
			}).repeat(-1);
		},
		BlackWhitePlanetPath(){
			const planet = document.getElementById('black-white-planet');

			const xtl = this.timelineSets.bwptl.x;
			const ytl = this.timelineSets.bwptl.y;
			const ztl = this.timelineSets.bwptl.z;

			gsap.set(planet, {
				x: '30vw',
				xPercent: -50,
				yPercent: -50,
				top: '50%',
				left: '50%'
			})

			xtl.to(planet, {
				duration: this.planetPathDuration * 2,
				x: '-=60vw',
				ease: 'power1.inOut',
				yoyo: true,
				repeat: -1
			});

			ytl.to(planet, {
				duration: this.planetPathDuration,
				y: '-=5vw',
				ease: 'power1.out'
			}).to(planet, {
				duration: this.planetPathDuration,
				y: '+=5vw',
				ease: 'power1.in'
			})

			.set(planet, {
				css: {
					zIndex: 6
				}
			})

			.to(planet, {
				duration: this.planetPathDuration,
				y: '+=5vw',
				ease: 'power1.out'
			}).to(planet, {
				duration: this.planetPathDuration,
				y: '-=5vw',
				ease: 'power1.in'
			}).repeat(-1);

			// Z (width/size) animation
			ztl.to(planet, {
				duration: this.planetPathDuration,
				// width: '-=4vw',
				scale: .4,
				ease: 'power1.out'
			}).to(planet, {
				duration: this.planetPathDuration,
				// width: '+=4vw',
				scale: 1,
				ease: 'power1.in'
			}).to(planet, {
				duration: this.planetPathDuration,
				// width: '+=4vw',
				scale: 1.6,
				ease: 'power1.out'
			}).to(planet, {
				duration: this.planetPathDuration,
				// width: '-=4vw',
				scale: 1,
				ease: 'power1.in'
			}).repeat(-1);
		},
		BigGreenPlanetPath(){
			const planet = document.getElementById('big-green-planet');
			const xtl = this.timelineSets.bgptl.x;
			const ytl = this.timelineSets.bgptl.y;
			const ztl = this.timelineSets.bgptl.z;

			gsap.set(planet, {
				x: 0,
				y: '+=5vw',
				width: '+=4vw',
				xPercent: -50,
				yPercent: -50,
				top: '50%',
				left: '50%'
			})

			xtl.to(planet, {
				duration: this.planetPathDuration,
				x: '+=30vw',
				ease: 'power1.out',
			})

			.set(planet, {
				css: {
					zIndex: 4
				}
			})

			.to(planet, {
				duration: this.planetPathDuration * 2,
				x: '-=60vw',
				ease: 'power1.inOut'
			})

			.set(planet, {
				css: {
					zIndex: 6
				}
			})

			.to(planet, {
				duration: this.planetPathDuration,
				x: '+=30vw',
				ease: 'power1.in'
			}).repeat(-1);

			// Y animation
			ytl.to(planet, {
				duration: this.planetPathDuration * 2,
				y: '-=10vw',
				ease: 'power1.inOut',
				yoyo: true,
				repeat: -1
			})

			// Z (width/size) animation
			ztl.to(planet, {
				duration: this.planetPathDuration * 2,
				// width: '-=8vw',
				scale: .2,
				yoyo: true,
				ease: 'power1.inOut',
				repeat: -1
			})
		},

		StartPlanetPaths(){
			this.RedGreenPlanetPath();
			this.BlackWhitePlanetPath();
			this.BigGreenPlanetPath();
		},

		StartSun(){
			const tl = gsap.timeline();

			tl.to('#sun circle', {
				duration: 6,
				fill: '#fff', // White
				yoyo: true,
				ease: 'power1.inOut',
				repeat: -1
			}).to('#sun', {
				duration: 3,
				scale: 1.1,
				yoyo: true,
				ease: 'power1.inOut',
				repeat: -1
			}, 0);
		},

		EnablePlanetClickability(){
			for(const planet of document.getElementsByClassName('planet')){
				planet.addEventListener('click', event=>{
					let tl;

					switch(event.currentTarget.id){
						case 'red-planet-green-ring':
							tl = this.timelineSets.rgptl;
							this.currentPage = this.pages.rgp;
							break;
						case 'black-white-planet':
							tl = this.timelineSets.bwptl;
							this.currentPage = this.pages.bwp;
							break;
						case 'big-green-planet':
							tl = this.timelineSets.bgptl;
							this.currentPage = this.pages.bgp;
							break;
					}

					const xtl = tl.x;
					const ytl = tl.y;
					const ztl = tl.z;

					// if(ytl.paused()){
					// 	this.currentPlanet.reverse();
					// }
					if(!ytl.paused()){
						this.currentPlanet = gsap.timeline({
							onStart: this.TogglePlanetMovement,
							onReverseComplete: this.TogglePlanetMovement
						});

						this.currentPlanet.to(event.currentTarget, {
							duration: .8,
							width: '300vw',
							scale: 1,
							ease: 'power3.inOut',
						}).to(this.currentPage, {
							duration: .4,
							height: '100%'
						}, 0.4).set('.planet-pages', {
							display: 'block'
						}, 0.5)
						.set(event.currentTarget, {
							css: {
								zIndex: 8,
							}
						}, 0);
					}
				})
			}
		},

		TogglePlanetMovement(){
			for(const i in this.timelineSets){
				this.timelineSets[i].x.paused(!this.tlPaused);
				this.timelineSets[i].y.paused(!this.tlPaused);
				this.timelineSets[i].z.paused(!this.tlPaused);
			}

			this.tlPaused = !this.tlPaused;
		}
	},
    mounted: function(){
		this.ResetTimelines();
		this.StartSun();
		this.StartPlanetPaths();
		this.EnablePlanetClickability();
		document.getElementsByClassName('close-page')[0].addEventListener('click', (event)=>{
			this.currentPlanet.reverse();
		})
    }
}
</script>

